import React from 'react';
import * as styles from './home.module.scss';

const Home = () => {
    return (
        <div className={styles.home}>
            <h1>"Welcome to Sbrikki's Books"</h1>
            <h2>"Join us in this Book Club for nights full of reading"</h2>
        </div>
    )
}

export default Home
